import React from 'react';
const Piece = (props) => {
  return (
      <div className="col-sm-4">
          <div className = "images">
            {pieces.map((piece, index) => (
                <div key = {index}>
                    <image src={props.piece.imagesMain.url} className="card-img-top" />
                </div>
                ))}
            </div>
            <div className="card-body">
              <h5 className="card-title">{props.piece.name}</h5>
              <p className="card-title">$ {props.piece.fullText}</p>
            </div>
          </div>
  );
}
export default Piece;
